import React from 'react';
import * as S from './VisualForm.styled';

const VisualForm = () => {
    return (
        <S.Root>
            <S.Line>
                <S.Label>Имя</S.Label>
                <S.Input placeholder='Введите своё имя' />
            </S.Line>
            <S.Line>
                <S.Label>E-mail</S.Label>
                <S.Input placeholder='Введите свой е-mail' />
            </S.Line>
        </S.Root>
    );
};

export default VisualForm;
